import React, {Component} from 'react';

export default class News extends Component {
    render() {
      return (
        <div className="container">
            <div className="teste-class">
            <h1>
                NOTÍCIAS
            </h1>
            </div>


            <div className="row">
                <div className="col">Próximos</div>
                <div className="col">Aconteceu</div>
            </div>
        </div>
      );
    };
  };
